const ListadoEquipos = () => {

    //aca iba algo asi:
    /*
    equipos : [
        {nombre: 'Equipo1'},
        {nombre: 'Equipo2'},
        {nombre: 'Equipo3'}
    ],
    */
    
/*
    return (
        <ul className="Listado-proyectos">
            {equipos.map(equipo => (
                <Equipo
                    equipo={equipo}
                />
